import React from "react";

const ExpensesList = props => { 
    filteredYear.map((item) => {
        return (
            <ExpenseItem
                key={ item.id}
                itemDate={item.date}
                itemName={item.title}
                itemPrice={item.amount}
            />
        );
    })
}

export default ExpensesList;
